    localStorage.setItem("messages", JSON.stringify(rawMessages));

    // simulate success callback
    setTimeout(function () {
      var ServerAction = require("../actions/ServerAction.coffee");
      ServerAction.receiveCreatedMessage(createdMessage);
    }, 0);
